import styled from 'styled-components';

export const StyledHeader = styled.div`
  background: #1c1c1c;
  box-sizing: border-box;

  .header-content {
    max-width: 1280px;
    margin: 0 auto;
    box-sizing: border-box;
  }
`;

export const StyledRMDBLogo = styled.img`

  @media screen and (max-width: 200px) {
    width: 200px;
    height: 200px;
    margin-top: 5px;
  }
`;
